PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;

DROP TABLE IF EXISTS tupa;
DROP TABLE IF EXISTS jasenet;
DROP TABLE IF EXISTS joukkueet;
DROP TABLE IF EXISTS sarjat;
DROP TABLE IF EXISTS rastit;
DROP TABLE IF EXISTS kilpailut;


CREATE TABLE kilpailut (
   id        INTEGER  NOT NULL PRIMARY KEY AUTOINCREMENT, 
   nimi      VARCHAR(128) NOT NULL,
   alkuaika  DATETIME  NOT NULL CHECK( alkuaika < loppuaika),
   loppuaika DATETIME  NOT NULL CHECK( loppuaika > alkuaika),
   kesto     INTEGER  NOT NULL CHECK( kesto > 0 )
);
CREATE TABLE sarjat(
   id        INTEGER  NOT NULL PRIMARY KEY  AUTOINCREMENT,
   nimi      VARCHAR(16) NOT NULL,
   matka     VARCHAR(16) NOT NULL,
   alkuaika  DATETIME  NULL CHECK( alkuaika < loppuaika),
   loppuaika DATETIME  NULL CHECK( loppuaika > alkuaika),
   kesto     INTEGER  NOT NULL CHECK( kesto > 0 ),
   kilpailu  INTEGER  NOT NULL,
   CONSTRAINT sarjat_kilpailu 
	FOREIGN KEY (kilpailu)
	REFERENCES kilpailut (id)
		ON DELETE NO ACTION
		ON UPDATE CASCADE

);
CREATE TABLE rastit(
   id       INTEGER NOT NULL PRIMARY KEY  AUTOINCREMENT,
   koodi    VARCHAR(24) NOT NULL,
   lon      NUMERIC(9,6) NOT NULL,
   lat      NUMERIC(9,6) NOT NULL,
   kilpailu INTEGER  NOT NULL,
   CONSTRAINT rastit_kilpailu 
	FOREIGN KEY (kilpailu)
	REFERENCES kilpailut (id)
		ON DELETE NO ACTION
		ON UPDATE CASCADE
);
CREATE TABLE joukkueet(
  id    INTEGER  NOT NULL PRIMARY KEY  AUTOINCREMENT,
  nimi  VARCHAR(128) NOT NULL,
  salasana VARCHAR(512) NULL,
  sarja INTEGER  NOT NULL,
  jasenet VARCHAR(2048)  DEFAULT '[]',
  CONSTRAINT joukkueet_unique
   UNIQUE ( nimi, sarja ),
  CONSTRAINT joukkueet_sarja 
	FOREIGN KEY (sarja)
	REFERENCES sarjat (id)
		ON DELETE NO ACTION
		ON UPDATE CASCADE
);

CREATE TABLE tupa(
   aika    DATETIME  NOT NULL,
   rasti   INTEGER  NOT NULL,
   joukkue INTEGER  NOT NULL,
   CONSTRAINT tupa_PK
      PRIMARY KEY(aika,rasti,joukkue),
   CONSTRAINT tupa_rasti 
	FOREIGN KEY (rasti)
	REFERENCES rastit (id)
		ON DELETE NO ACTION
		ON UPDATE CASCADE,
   CONSTRAINT tupa_joukkue 
	FOREIGN KEY (joukkue)
	REFERENCES joukkueet (id)
		ON DELETE NO ACTION
		ON UPDATE CASCADE
);
DELETE FROM sqlite_sequence;
COMMIT;
